// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import './IROCNFTMint.sol';

contract ROCBlindBox1 is ReentrancyGuard, Ownable, Pausable {

    struct BlindBoxInfo {
        uint256 baseTokenId;
        uint32 nextBoxIndex;
        uint32 totalCount;
        uint256 price;
        mapping(address => uint32) userAlreadyBuyCount;
    }
    
    struct BlindBoxViewInfo {
        uint32 totalCount;
        uint32 soldCount;
        uint256 price;
    }

    BlindBoxInfo[4] public blindBoxInfos;
    address public admin1;
    address public admin2;
    IROCNFTMint public rocNFT;
    uint32 public limitedBuyCount = 2;
    uint256 public startSellTime;

    IERC20 public cateCoinToken;

    event BlindBoxOpened(
        address indexed payer,
        uint256 amount,
        uint8 indexed boxId,
        uint8 count,
        uint256 indexed baseBoxIndex,
        uint256[] tokenIds,
        uint256 date
    );


    constructor(address admin1Address, address admin2Address, address rocNFTAddress, address cateCoinTokenAddress, uint256[] memory priceValues) {
        
        require(priceValues.length == blindBoxInfos.length, "constructor: priceValues length is not 4");

        admin1 = admin1Address;
        admin2 = admin2Address;
        rocNFT = IROCNFTMint(rocNFTAddress);
        cateCoinToken = IERC20(cateCoinTokenAddress);
        
        setupBlindBoxInfo(0, 10001, 1120, priceValues[0]);
        setupBlindBoxInfo(1, 15601, 1120, priceValues[1]);
        setupBlindBoxInfo(2, 21201, 490, priceValues[2]);
        setupBlindBoxInfo(3, 23651, 70, priceValues[3]);
    }

    modifier boxIdIsValid(uint8 boxId) {
        require(boxId < blindBoxInfos.length, "boxId is not valid");
        _;
    }

    modifier buyCountIsValid(uint8 count) {
        require(count >= 1 && count <= 2, "buy count is not valid");
        _;
    }

    modifier whenNotSoldOut(uint8 boxId) {
        BlindBoxInfo storage boxInfo = blindBoxInfos[boxId];
        require(boxInfo.nextBoxIndex < boxInfo.totalCount,
            "Blind Box has sold out"
        );
        _;
    }

    modifier onStartSell() {
        require(startSellTime > 0 && block.timestamp > startSellTime, "not start sell");
        _;
    }

    function setupBlindBoxInfo(uint8 boxId, uint256 pBaseTokenId, uint32 pTotalCount, uint256 pPrice) private {
        BlindBoxInfo storage boxInfo = blindBoxInfos[boxId];
        boxInfo.baseTokenId = pBaseTokenId;
        boxInfo.nextBoxIndex = 0;
        boxInfo.totalCount = pTotalCount;
        boxInfo.price = pPrice;
    }
    
    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function setStartSellTime(uint256 t) external onlyOwner{
        startSellTime = t;
    }

    function updatePrice(
        uint8[] memory boxIds,
        uint256[] memory newPriceValues
    ) external onlyOwner {
        require(boxIds.length == newPriceValues.length, "updatePrice: boxIds and newPriceValues length mismatch");
        
        for (uint256 i = 0; i < boxIds.length; ++i) {
            require(boxIds[i] < blindBoxInfos.length, "updatePrice: boxId is invalid");
            blindBoxInfos[boxIds[i]].price = newPriceValues[i];
        }
    }

    function getLeftLimitBuyCount(address user, uint8 boxId) public view boxIdIsValid(boxId) returns (uint32) {
        return limitedBuyCount - blindBoxInfos[boxId].userAlreadyBuyCount[user];
    }

    // return all blind box user can buy
    function getAllLeftLimitBuyCount(address user) public view returns (uint32[] memory) {
        uint32[] memory ret = new uint32[](blindBoxInfos.length);
        
        for (uint256 i = 0; i < ret.length; ++i) {
            ret[i] = limitedBuyCount - blindBoxInfos[i].userAlreadyBuyCount[user];
        }
        return ret;
    }

    function getSoldCount(uint8 boxId) public view boxIdIsValid(boxId) returns (uint256) {
        return blindBoxInfos[boxId].nextBoxIndex;
    }

    function getTotalCount(uint8 boxId) public view boxIdIsValid(boxId) returns (uint256) {
        return blindBoxInfos[boxId].totalCount;
    }

    function getPrice(uint8 boxId) public view boxIdIsValid(boxId) returns (uint256) {
        return blindBoxInfos[boxId].price;
    }

    // return all blind box current info
    function getBlindBoxViewInfos() public view returns (BlindBoxViewInfo[] memory) {
        BlindBoxViewInfo[] memory ret = new BlindBoxViewInfo[](blindBoxInfos.length);
        
        for (uint256 i = 0; i < blindBoxInfos.length; ++i) {
            BlindBoxInfo storage boxInfo = blindBoxInfos[i];
            ret[i] = BlindBoxViewInfo(boxInfo.totalCount, boxInfo.nextBoxIndex, boxInfo.price);
        }
        return ret;
    }

    function payByToken(uint8 boxId, uint8 count) external onStartSell whenNotPaused boxIdIsValid(boxId) buyCountIsValid(count) whenNotSoldOut(boxId) nonReentrant {
        
        require(getLeftLimitBuyCount(msg.sender, boxId) >= count, "you can't buy more");
        
        BlindBoxInfo storage boxInfo = blindBoxInfos[boxId];
        require(boxInfo.totalCount - boxInfo.nextBoxIndex >= count, "stock not enough");

        {
            uint256 amount = boxInfo.price * count;
            require(cateCoinToken.allowance(msg.sender, address(this)) >= amount, "token allowance not enough");

            cateCoinToken.transferFrom(msg.sender, admin1, amount - amount/2);
            cateCoinToken.transferFrom(msg.sender, admin2, amount/2);
        }

        uint256 baseBoxInx = boxInfo.nextBoxIndex;
        boxInfo.nextBoxIndex += count;
        boxInfo.userAlreadyBuyCount[msg.sender] += count;

        uint256[] memory ids = new uint256[](5 * count);
        uint256[] memory amounts = new uint256[](5 * count);
        {
            uint256 baseId = boxInfo.baseTokenId + baseBoxInx * 5;
            for (uint256 i = 0; i < ids.length; i++) {
                ids[i] = baseId + i;
                amounts[i] = 1;
            }
        }
        rocNFT.mintBatch(msg.sender, ids, amounts, "");
        
        emit BlindBoxOpened(msg.sender, boxInfo.price, boxId, count, baseBoxInx, ids, block.timestamp);
    }
}
